package com.netease.vendor.domain;

public class AppSet {

	private String pvalue;
	private String pkey;
	private String preamrk;
	
	public String getPvalue() {
		return pvalue;
	}
	public void setPvalue(String pvalue) {
		this.pvalue = pvalue;
	}
	public String getPkey() {
		return pkey;
	}
	public void setPkey(String pkey) {
		this.pkey = pkey;
	}
	public String getPreamrk() {
		return preamrk;
	}
	public void setPreamrk(String pkeamrk) {
		this.preamrk = pkeamrk;
	}
}
